import {
  StyleSheet,
  TouchableOpacity,
  Text,
  View,
} from 'react-native'
import {widthPercentageToDP as wp, heightPercentageToDP as hp} from 'react-native-responsive-screen';
class ShopScreen extends Component {
  state = {
    count: 0
  }
  render(){
      return (
      <View style={styles.container}>
          <Text>{"\n"}</Text>
          <Text style={styles.heading}> Collect your Rewards!</Text>
      <Text>{"\n"}</Text>
      <Text>Choose from either extensions in Assignment Submission Date, or The Fantastic Dark Mode</Text>
      </View>

      )
  }
}


const styles = StyleSheet.create({
    container:{
      backgroundColor:"#ffffff",
      resizeMode: 'cover',
      flex: 2,
    },
    heading:{
        fontWeight:"light",
        color:"#25252a",
        fontSize:wp("8%"),
        fontFamily:'sans-serif'
    },
    content:{
        fontWeight:"light",
        color:"#25252a",
        fontSize:wp("5%"),
        fontFamily:'sans-serif',
        maxWidth:wp("50%"),
        flexShrink: 1,
        alignSelf:'center',
        paddingLeft:wp('10%'),
        paddingRight:wp('10%')
    }

  })
export default ShopScreen
